INSERT INTO `information_description` VALUES (4,1,0,'О нас','&lt;p&gt;\r\n	О нас&lt;/p&gt;\r\n','',0,'','','',''),(3,1,0,'Политика Безопасности','&lt;p&gt;\r\n	Политика Безопасности&lt;/p&gt;\r\n','',0,'','','',''),(6,1,2,'Доставка цветов - казань','&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;Обратите внимание на правила доставки:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;div class=&quot;image_border&quot; style=&quot;position: relative; display: inline-block;&quot;&gt;\r\n	&lt;img alt=&quot;&quot; src=&quot;http://kofc.ru/florentinproject/image/data/flowers/border.png&quot; style=&quot;width: 562px; height: 250px; margin-bottom: 20px;&quot; /&gt;\r\n	&lt;div class=&quot;border_text&quot; style=&quot;position: absolute; right: 50px; top: 50px; width: 290px;&quot;&gt;\r\n		При оформлении заказа до 17.00,&lt;br /&gt;\r\n		мы осуществим доставку на следующий день.&lt;br /&gt;\r\n		Все заказы, оформленные позже указанного&lt;br /&gt;\r\n		времени, доставляются через день.&lt;br /&gt;\r\n		&lt;br /&gt;\r\n		В пределах МКАД - БЕСПЛАТНО.&lt;br /&gt;\r\n		За пределами МКАД - уточните&lt;br /&gt;\r\n		стоимость при формировании заказа.&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;p&gt;\r\n	Хотим сообщить, что мы всегда рады сделать исключение! Позвоните нам и\\или пришлите письмо с темой “Срочная доставка!” на почту support@florentinproject.com, мы обязательно с Вами свяжемся и попробуем осуществить Ваш заказ раньше указанного срока, если это возможно!&lt;/p&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	&lt;em&gt;Если Вы предпочитаете более позднюю доставку, то всего лишь выберете необходимый день при оформлении заказа. Предоставьте нам всю необходимую информацию при оформлении заказа, и мы гарантируем надежность нашей услуги.&lt;/em&gt;&lt;/div&gt;\r\n','&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;div&gt;\r\n	Свежие цветы от Florentin упакованы&lt;/div&gt;\r\n&lt;div&gt;\r\n	в водяной шар, и доставляются&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	в шляпных коробках.&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	Это позволяет не распаковывать&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	букет в течение 2-3 дней и хранить&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	его временно в коробке, если у вас&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	под рукой нет вазы.&lt;/div&gt;\r\n',1,'','','',''),(8,1,0,'Персональный заказ','&lt;div&gt;\r\n	&lt;em&gt;Мы ценим уникальность каждого клиента и имеем возможность предложить вам персональное создание букета под вашу задачу. Свяжитесь с нашим менеджером&amp;nbsp;&lt;/em&gt;&lt;em&gt;или отправьте письмо с вашими пожеланиями и мы воплотим в жизнь любые цветочные идеи. &amp;nbsp;&lt;/em&gt;&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	Являясь бесконечными ценителями прекрасного, мы решили создать флористический проект нового формата. Соединив специально отобранные сорта великолепных роз, элегантные французские шляпные коробки и практичность конструкции, мы&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	представляем вам то, что призвано доставить истинное цветочное удовольствие!&lt;/div&gt;\r\n&lt;div&gt;\r\n	Каждый букет будет собран с любовью наших флористов, с особой аккуратностью доставлен нашей службой курьеров, и в дальнейшем будет дарить только прекрасные эмоции. Подари немного больше, чем просто цветы! Каждый букет будет собран с любовью наших флористов, с особой аккуратностью доставлен нашей службой курьеров, и в дальнейшем будет дарить только прекрасные эмоции. Подари немного больше, чем просто цветы!&lt;/div&gt;\r\n&lt;p&gt;\r\n	&lt;a class=&quot;button big_b blue_b&quot; href=&quot;#quick_order_box&quot; id=&quot;quick_order&quot; style=&quot;margin-top:10px;&quot;&gt;Отправить заявку&lt;/a&gt;&lt;/p&gt;\r\n','',1,'','','',''),(10,1,0,'Уход','&lt;div class=&quot;yhod&quot;&gt;\r\n	&lt;div class=&quot;yhod_block&quot;&gt;\r\n		&lt;div class=&quot;number&quot;&gt;\r\n			&lt;table&gt;\r\n				&lt;tbody&gt;\r\n					&lt;tr&gt;\r\n						&lt;td&gt;\r\n							1.&lt;/td&gt;\r\n					&lt;/tr&gt;\r\n				&lt;/tbody&gt;\r\n			&lt;/table&gt;\r\n		&lt;/div&gt;\r\n		&lt;div class=&quot;yhod_image&quot;&gt;\r\n			&lt;img src=&quot;catalog/view/theme/florentin/image/yhod_1.png&quot; /&gt;&lt;/div&gt;\r\n		&lt;div class=&quot;clear&quot;&gt;\r\n			&amp;nbsp;&lt;/div&gt;\r\n		&lt;div class=&quot;text&quot;&gt;\r\n			Свежие цветы от Florentin упакованы в водяной шар и доставляются в шляпной коробке. Такая упаковка может служить временной вазой, но не более 2-3 дней. Соответственно, у вас нет необходимости сразу распаковывать букет.&lt;/div&gt;\r\n	&lt;/div&gt;\r\n	&lt;div class=&quot;yhod_block&quot;&gt;\r\n		&lt;div class=&quot;number&quot;&gt;\r\n			&lt;table&gt;\r\n				&lt;tbody&gt;\r\n					&lt;tr&gt;\r\n						&lt;td&gt;\r\n							2.&lt;/td&gt;\r\n					&lt;/tr&gt;\r\n				&lt;/tbody&gt;\r\n			&lt;/table&gt;\r\n		&lt;/div&gt;\r\n		&lt;div class=&quot;yhod_image&quot;&gt;\r\n			&lt;img src=&quot;catalog/view/theme/florentin/image/yhod_2.png&quot; /&gt;&lt;/div&gt;\r\n		&lt;div class=&quot;clear&quot;&gt;\r\n			&amp;nbsp;&lt;/div&gt;\r\n		&lt;div class=&quot;text&quot;&gt;\r\n			Чтобы продлить жизнь цветам, вытащите букет из коробки, освободите от водяного шара и поставьте в вазу.&lt;/div&gt;\r\n	&lt;/div&gt;\r\n	&lt;div class=&quot;yhod_block&quot;&gt;\r\n		&lt;div class=&quot;number&quot;&gt;\r\n			&lt;table&gt;\r\n				&lt;tbody&gt;\r\n					&lt;tr&gt;\r\n						&lt;td&gt;\r\n							3.&lt;/td&gt;\r\n					&lt;/tr&gt;\r\n				&lt;/tbody&gt;\r\n			&lt;/table&gt;\r\n		&lt;/div&gt;\r\n		&lt;div class=&quot;yhod_image&quot;&gt;\r\n			&lt;img src=&quot;catalog/view/theme/florentin/image/yhod_3.png&quot; /&gt;&lt;/div&gt;\r\n		&lt;div class=&quot;clear&quot;&gt;\r\n			&amp;nbsp;&lt;/div&gt;\r\n		&lt;div class=&quot;text&quot;&gt;\r\n			Подрежьте стебли на 1-2 см под острым углом, очистите их от нижних листьев и шипов.&lt;/div&gt;\r\n	&lt;/div&gt;\r\n	&lt;div class=&quot;yhod_block&quot;&gt;\r\n		&lt;div class=&quot;number&quot;&gt;\r\n			&lt;table&gt;\r\n				&lt;tbody&gt;\r\n					&lt;tr&gt;\r\n						&lt;td&gt;\r\n							4.&lt;/td&gt;\r\n					&lt;/tr&gt;\r\n				&lt;/tbody&gt;\r\n			&lt;/table&gt;\r\n		&lt;/div&gt;\r\n		&lt;div class=&quot;yhod_image&quot;&gt;\r\n			&lt;img src=&quot;catalog/view/theme/florentin/image/yhod_4.png&quot; /&gt;&lt;/div&gt;\r\n		&lt;div class=&quot;clear&quot;&gt;\r\n			&amp;nbsp;&lt;/div&gt;\r\n		&lt;div class=&quot;text&quot;&gt;\r\n			Налейте в вазу холодную, чистую воду и добавьте удобрение из пластикового пакета в вазу с водой. Не используйте удобрение для других целей!&lt;/div&gt;\r\n	&lt;/div&gt;\r\n	&lt;div class=&quot;yhod_block&quot;&gt;\r\n		&lt;div class=&quot;number&quot;&gt;\r\n			&lt;table&gt;\r\n				&lt;tbody&gt;\r\n					&lt;tr&gt;\r\n						&lt;td&gt;\r\n							5.&lt;/td&gt;\r\n					&lt;/tr&gt;\r\n				&lt;/tbody&gt;\r\n			&lt;/table&gt;\r\n		&lt;/div&gt;\r\n		&lt;div class=&quot;yhod_image&quot;&gt;\r\n			&lt;img src=&quot;catalog/view/theme/florentin/image/yhod_5.png&quot; /&gt;&lt;/div&gt;\r\n		&lt;div class=&quot;clear&quot;&gt;\r\n			&amp;nbsp;&lt;/div&gt;\r\n		&lt;div class=&quot;text&quot;&gt;\r\n			Рекомендуем не срезать ленту, связывающую букет, для сохранения формы букета.&lt;/div&gt;\r\n	&lt;/div&gt;\r\n	&lt;div class=&quot;yhod_block&quot;&gt;\r\n		&lt;div class=&quot;number&quot;&gt;\r\n			&lt;table&gt;\r\n				&lt;tbody&gt;\r\n					&lt;tr&gt;\r\n						&lt;td&gt;\r\n							6.&lt;/td&gt;\r\n					&lt;/tr&gt;\r\n				&lt;/tbody&gt;\r\n			&lt;/table&gt;\r\n		&lt;/div&gt;\r\n		&lt;div class=&quot;yhod_image&quot;&gt;\r\n			&lt;img src=&quot;catalog/view/theme/florentin/image/yhod_6.png&quot; /&gt;&lt;/div&gt;\r\n		&lt;div class=&quot;clear&quot;&gt;\r\n			&amp;nbsp;&lt;/div&gt;\r\n		&lt;div class=&quot;text&quot;&gt;\r\n			Для продления жизни цветам рекомендуем поставить букет в прохладном месте, вдали от солнечных лучей.&lt;/div&gt;\r\n	&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;style type=&quot;text/css&quot;&gt;\r\n.yhod {\r\n	margin-top:20px;\r\n}\r\n.yhod_block {\r\n	float:left;\r\n	width:280px;\r\n	min-height:240px;\r\n	padding: 0 20px;\r\n}\r\n.yhod_block .number {\r\n	font-family: \'carolinaregular\';\r\n	font-size: 32px;\r\n	letter-spacing: 0px;\r\n	color: #241F20;\r\n	float:left;\r\n        margin-top:12px;\r\n}\r\n.yhod_block .number td {\r\n	height:116px;\r\n	vertical-align:bottom;\r\n	font-size: 32px;\r\n	line-height: 30px;\r\n}\r\n.yhod_block .yhod_image {\r\n	float:left;\r\n	padding-left:10px;\r\n	text-align:left;\r\n}\r\n.yhod_block .text {\r\n	margin-top:5px;\r\n}&lt;/style&gt;\r\n','',0,'','','',''),(5,1,0,'Условия соглашения','&lt;p&gt;\r\n	Условия соглашения&lt;/p&gt;\r\n','',0,'','','',''),(9,1,0,'Корпоративный сервис ','&lt;p&gt;\r\n	Мы предлагаем новую услугу в сфере флористики для корпоративных клиентов. Наш подход позволяет подобрать цветы, размер и цвет коробки, отражающие фирменный стиль вашей компании. Мы готовы создать индивидуальный дизайн букета в шляпной коробке, исходя из поставленных задач и целей. Подобрать необходимый цвет, изменить размеры, изготовить коробки с вашим логотипом или в необходимом дизайне – все возможно!&lt;/p&gt;\r\n&lt;p dir=&quot;ltr&quot; style=&quot;line-height:1;margin-top:0pt;margin-bottom:0pt;&quot;&gt;\r\n	&lt;b id=&quot;docs-internal-guid-f9ea41a7-b44f-c9de-9e30-86a8102c42d6&quot; style=&quot;font-weight:normal;&quot;&gt;&lt;span style=&quot;font-size: 9px; font-family: \'Times New Roman\'; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;table border=&quot;0&quot; cellpadding=&quot;1&quot; cellspacing=&quot;1&quot; style=&quot;width: 570px;&quot;&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td style=&quot;padding-right:40px;&quot;&gt;\r\n				&lt;span style=&quot;font-size:13px;&quot;&gt;&lt;b id=&quot;docs-internal-guid-f9ea41a7-b44f-c9de-9e30-86a8102c42d6&quot; style=&quot;line-height: 12px; font-weight: normal;&quot;&gt;&lt;span style=&quot;font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-style: italic; vertical-align: baseline; white-space: pre-wrap;&quot;&gt;Яркий, свежий и необычный подарок для ваших незаменимых сотрудников, дорогих клиентов и партнеров.&lt;/span&gt;&lt;/b&gt;&lt;/span&gt;&lt;/td&gt;\r\n			&lt;td&gt;\r\n				&lt;b id=&quot;docs-internal-guid-f9ea41a7-b44f-c9de-9e30-86a8102c42d6&quot; style=&quot;line-height: 12px; font-weight: normal;&quot;&gt;&lt;span style=&quot;font-size:13px;font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-style: italic; vertical-align: baseline; white-space: pre-wrap;&quot;&gt;Необычная рекламная продукция или корпоративный продукт для различных мероприятий.&lt;/span&gt;&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Все букеты от Florentin упакованы в водяной шар и доставляются в шляпных коробках, это позволяет не распаковывать букет в течение 2-3 дней и хранить его временно в коробке, если у вас нет вазы под рукой.&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	В силу практичности нашей упаковки, вам всегда будет удобно преподнести такой букет и оставить прекрасное впечатление.&lt;/p&gt;\r\n&lt;p&gt;\r\n	Отправьте заявку и наш менеджер свяжется с вами в ближайшее время.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;a class=&quot;button big_b blue_b&quot; href=&quot;#quick_order_box&quot; id=&quot;quick_order&quot; style=&quot;margin-top:10px;&quot;&gt;Отправить заявку&lt;/a&gt;&lt;/p&gt;\r\n','',1,'','','',''),(11,1,1,'Спец.предложение - ульяновск','&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;div&gt;\r\n	&lt;em&gt;&lt;span style=&quot;background-color:#ffff00;&quot;&gt;Мы ценим уникальность каждого клиента и имеем возможность предложить вам персональное создание букета под вашу задачу. Свяжитесь с нашим менеджером&amp;nbsp;&lt;/span&gt;&lt;/em&gt;&lt;em&gt;&lt;span style=&quot;background-color:#ffff00;&quot;&gt;или отправьте письмо с вашими пожеланиями и мы воплотим в жизнь любые цветочные идеи. &amp;nbsp;&lt;/span&gt;&lt;/em&gt;&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	&lt;span style=&quot;background-color:#ffff00;&quot;&gt;Являясь бесконечными ценителями прекрасного, мы решили создать флористический проект нового формата. Соединив специально отобранные сорта великолепных роз, элегантные французские шляпные коробки и практичность конструкции, мы&amp;nbsp;&lt;/span&gt;&lt;/div&gt;\r\n&lt;div&gt;\r\n	&lt;span style=&quot;background-color:#ffff00;&quot;&gt;представляем вам то, что призвано доставить истинное цветочное удовольствие!&lt;/span&gt;&lt;/div&gt;\r\n&lt;div&gt;\r\n	&lt;span style=&quot;background-color:#ffff00;&quot;&gt;Каждый букет будет собран с любовью наших флористов, с особой аккуратностью доставлен нашей службой курьеров, и в дальнейшем будет дарить только прекрасные эмоции. Подари немного больше, чем просто цветы! Каждый букет будет собран с любовью наших флористов, с особой аккуратностью доставлен нашей службой курьеров, и в дальнейшем будет дарить только прекрасные эмоции. Подари немного больше, чем просто цветы!&lt;/span&gt;&lt;/div&gt;\r\n&lt;p&gt;\r\n	&lt;a class=&quot;button big_b blue_b&quot; href=&quot;#quick_order_box&quot; id=&quot;quick_order&quot; style=&quot;margin-top: 10px;&quot;&gt;&lt;span style=&quot;background-color:#ffff00;&quot;&gt;Отправить заявку&lt;/span&gt;&lt;/a&gt;&lt;/p&gt;\r\n','&lt;p&gt;\r\n	Спец.предложение&lt;/p&gt;\r\n',1,'','','',''),(12,1,1,'Сотрудничество - ульяновск','&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;background-color:#ffff00;&quot;&gt;Мы предлагаем новую услугу в сфере флористики для корпоративных клиентов. Наш подход позволяет подобрать цветы, размер и цвет коробки, отражающие фирменный стиль вашей компании. Мы готовы создать индивидуальный дизайн букета в шляпной коробке, исходя из поставленных задач и целей. Подобрать необходимый цвет, изменить размеры, изготовить коробки с ваш