tyle=&quot;background-color:#00ffff;&quot;&gt;представляем вам то, что призвано доставить истинное цветочное удовольствие!&lt;/span&gt;&lt;/div&gt;\r\n&lt;div&gt;\r\n	&lt;span style=&quot;background-color:#00ffff;&quot;&gt;Каждый букет будет собран с любовью наших флористов, с особой аккуратностью доставлен нашей службой курьеров, и в дальнейшем будет дарить только прекрасные эмоции. Подари немного больше, чем просто цветы! Каждый букет будет собран с любовью наших флористов, с особой аккуратностью доставлен нашей службой курьеров, и в дальнейшем будет дарить только прекрасные эмоции. Подари немного больше, чем просто цветы!&lt;/span&gt;&lt;/div&gt;\r\n','',0,'','','',''),(6,1,1,'Доставка цветов - ульяновск','&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;Обратите внимание на правила доставки:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;div class=&quot;image_border&quot; style=&quot;position: relative; display: inline-block;&quot;&gt;\r\n	&lt;img alt=&quot;&quot; src=&quot;http://kofc.ru/florentinproject/image/data/flowers/border.png&quot; style=&quot;width: 562px; height: 250px; margin-bottom: 20px;&quot; /&gt;\r\n	&lt;div class=&quot;border_text&quot; style=&quot;position: absolute; right: 50px; top: 50px; width: 290px;&quot;&gt;\r\n		При оформлении заказа до 17.00,&lt;br /&gt;\r\n		мы осуществим доставку на следующий день.&lt;br /&gt;\r\n		Все заказы, оформленные позже указанного&lt;br /&gt;\r\n		времени, доставляются через день.&lt;br /&gt;\r\n		&lt;br /&gt;\r\n		В пределах МКАД - БЕСПЛАТНО.&lt;br /&gt;\r\n		За пределами МКАД - уточните&lt;br /&gt;\r\n		стоимость при формировании заказа.&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;p&gt;\r\n	Хотим сообщить, что мы всегда рады сделать исключение! Позвоните нам и\\или пришлите письмо с темой “Срочная доставка!” на почту support@florentinproject.com, мы обязательно с Вами свяжемся и попробуем осуществить Ваш заказ раньше указанного срока, если это возможно!&lt;/p&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	&lt;em&gt;Если Вы предпочитаете более позднюю доставку, то всего лишь выберете необходимый день при оформлении заказа. Предоставьте нам всю необходимую информацию при оформлении заказа, и мы гарантируем надежность нашей услуги.&lt;/em&gt;&lt;/div&gt;\r\n','&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;div&gt;\r\n	Свежие цветы от Florentin упакованы&lt;/div&gt;\r\n&lt;div&gt;\r\n	в водяной шар, и доставляются&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	в шляпных коробках.&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	Это позволяет не распаковывать&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	букет в течение 2-3 дней и хранить&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	его временно в коробке, если у вас&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	под рукой нет вазы.&lt;/div&gt;\r\n',1,'','','',''),(6,1,0,'Доставка цветов','&lt;p&gt;\r\n	&lt;strong&gt;Обратите внимание на правила доставки:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;div class=&quot;image_border&quot;&gt;\r\n	&lt;img alt=&quot;&quot; src=&quot;http://kofc.ru/florentinproject/image/data/flowers/border.png&quot; style=&quot;width: 562px; height: 250px; margin-bottom: 20px;&quot; /&gt;\r\n	&lt;div class=&quot;border_text&quot;&gt;\r\n		&lt;span style=&quot;font-size:12px;&quot;&gt;При оформлении заказа до 17.00,&lt;br /&gt;\r\n		мы осуществим доставку на следующий день.&lt;br /&gt;\r\n		Все заказы, оформленные позже указанного&lt;br /&gt;\r\n		времени, доставляются через день.&lt;br /&gt;\r\n		&lt;br /&gt;\r\n		В пределах МКАД - БЕСПЛАТНО.&lt;br /&gt;\r\n		За пределами МКАД - уточните&lt;br /&gt;\r\n		стоимость при формировании заказа.&lt;/span&gt;&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;p&gt;\r\n	Хотим сообщить, что мы всегда рады сделать исключение! Позвоните нам и\\или пришлите письмо с темой “Срочная доставка!” на почту support@florentinproject.com, мы обязательно с Вами свяжемся и попробуем осуществить Ваш заказ раньше указанного срока, если это возможно!&lt;/p&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	&lt;em&gt;Если Вы предпочитаете более позднюю доставку, то всего лишь выберете необходимый день при оформлении заказа. Предоставьте нам всю необходимую информацию при оформлении заказа, и мы гарантируем надежность нашей услуги.&lt;/em&gt;&lt;/div&gt;\r\n&lt;style type=&quot;text/css&quot;&gt;\r\n.image_border {\r\nposition:relative;\r\ndisplay: inline-block;\r\n}\r\n.border_text {\r\nposition: absolute;\r\nright: 50px;\r\ntop: 50px;\r\nwidth: 290px;\r\n}&lt;/style&gt;\r\n','&lt;div&gt;\r\n	Свежие цветы от Florentin упакованы&lt;/div&gt;\r\n&lt;div&gt;\r\n	в водяной шар, и доставляются&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	в шляпных коробках.&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	Это позволяет не распаковывать&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	букет в течение 2-3 дней и хранить&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	его временно в коробке, если у вас&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	под рукой нет вазы.&lt;/div&gt;\r\n',1,'','','',''),(11,1,2,'Спец.предложение - казань','&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;div&gt;\r\n	&lt;em&gt;&lt;span style=&quot;background-color:#00ffff;&quot;&gt;Мы ценим уникальность каждого клиента и имеем возможность предложить вам персональное создание букета под вашу задачу. Свяжитесь с нашим менеджером&amp;nbsp;&lt;/span&gt;&lt;/em&gt;&lt;em&gt;&lt;span style=&quot;background-color:#00ffff;&quot;&gt;или отправьте письмо с вашими пожеланиями и мы воплотим в жизнь любые цветочные идеи. &amp;nbsp;&lt;/span&gt;&lt;/em&gt;&lt;/div&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;\r\n	&lt;span style=&quot;background-color:#00ffff;&quot;&gt;Являясь бесконечными ценителями прекрасного, мы решили создать флористический проект нового формата. Соединив специально отобранные сорта великолепных роз, элегантные французские шляпные коробки и практичность конструкции, мы&amp;nbsp;&lt;/span&gt;&lt;/div&gt;\r\n&lt;div&gt;\r\n	&lt;span style=&quot;background-color:#00ffff;&quot;&gt;представляем вам то, что призвано доставить истинное цветочное удовольствие!&lt;/span&gt;&lt;/div&gt;\r\n&lt;div&gt;\r\n	&lt;span style=&quot;background-color:#00ffff;&quot;&gt;Каждый букет будет собран с любовью наших флористов, с особой аккуратностью доставлен нашей службой курьеров, и в дальнейшем будет дарить только прекрасные эмоции. Подари немного больше, чем просто цветы! Каждый букет будет собран с любовью наших флористов, с особой аккуратностью доставлен нашей службой курьеров, и в дальнейшем будет дарить только прекрасные эмоции. Подари немного больше, чем просто цветы!&lt;/span&gt;&lt;/div&gt;\r\n&lt;p&gt;\r\n	&lt;a class=&quot;button big_b blue_b&quot; href=&quot;#quick_order_box&quot; id=&quot;quick_order&quot; style=&quot;margin-top: 10px;&quot;&gt;&lt;span style=&quot;background-color:#00ffff;&quot;&gt;Отправить заявку&lt;/span&gt;&lt;/a&gt;&lt;/p&gt;\r\n','',0,'','','',''),(12,1,2,'Сотрудничество - казань','&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;background-color:#00ffff;&quot;&gt;Мы предлагаем новую услугу в сфере флористики для корпоративных клиентов. Наш подход позволяет подобрать цветы, размер и цвет коробки, отражающие фирменный стиль вашей компании. Мы готовы создать индивидуальный дизайн букета в шляпной коробке, исходя из поставленных задач и целей. Подобрать необходимый цвет, изменить размеры, изготовить коробки с вашим логотипом или в необходимом дизайне – все возможно!&lt;/span&gt;&lt;/p&gt;\r\n&lt;p dir=&quot;ltr&quot; style=&quot;line-height: 1; margin-top: 0pt; margin-bottom: 0pt;&quot;&gt;\r\n	&lt;b id=&quot;docs-internal-guid-f9ea41a7-b44f-c9de-9e30-86a8102c42d6&quot; style=&quot;font-weight: normal;&quot;&gt;&lt;span style=&quot;font-size: 9px; font-family: \'Times New Roman\'; color: rgb(0, 0, 0); vertical-align: baseline; white-space: pre-wrap;&quot;&gt;&lt;span style=&quot;background-color:#00ffff;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;table border=&quot;0&quot; cellpadding=&quot;1&quot; cellspacing=&quot;1&quot; style=&quot;width: 570px;&quot;&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td style=&quot;padding-right: 40px;&quot;&gt;\r\n				&lt;span style=&quot;font-size: 13px;&quot;&gt;&lt;b id=&quot;docs-internal-guid-f9ea41a7-b44f-c9de-9e30-86a8102c42d6&quot; style=&quot;line-height: 12px; font-weight: normal;&quot;&gt;&lt;span style=&quot;font-family: Arial; color: rgb(0, 0, 0); font-style: italic; vertical-align: baseline; white-space: pre-wrap;&quot;&gt;&lt;span style=&quot;background-color:#00ffff;&quot;&gt;Яркий, свежий и необычный подарок для ваших незаменимых сотрудников, дорогих клиентов и партнеров.&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/span&gt;&lt;/td&gt;\r\n			&lt;td&gt;\r\n				&lt;b id=&quot;docs-internal-guid-f9ea41a7-b44f-c9de-9e30-86a8102c42d6&quot; style=&quot;line-height: 12px; font-weight: normal;&quot;&gt;&lt;span style=&quot;font-size: 13px; font-family: Arial; color: rgb(0, 0, 0); font-style: italic; vertical-align: baseline; white-space: pre-wrap;&quot;&gt;&lt;span style=&quot;background-color:#00ffff;&quot;&gt;Необычная рекламная продукция или корпоративный продукт для различных мероприятий.&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;background-color:#00ffff;&quot;&gt;Все букеты от Florentin упакованы в водяной шар и доставляются в шляпных коробках, это позволяет не распаковывать букет в течение 2-3 дней и хранить его временно в коробке, если у вас нет вазы под рукой.&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;background-color:#00ffff;&quot;&gt;В силу практичности нашей упаковки, вам всегда будет удобно преподнести такой букет и оставить прекрасное впечатление.&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;background-color:#00ffff;&quot;&gt;Отправьте заявку и наш менеджер свяжется с вами в ближайшее время.&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;a class=&quot;button big_b blue_b&quot; href=&quot;#quick_order_box&quot; id=&quot;quick_order&quot; style=&quot;margin-top: 10px;&quot;&gt;&lt;span style=&quot;background-color:#00ffff;&quot;&gt;Отправить заявку&lt;/span&gt;&lt;/a&gt;&lt;/p&gt;\r\n','',0,'','','','');
