INSERT INTO `product_description` VALUES (40,1,'No 1','&lt;p&gt;\r\n	Классика в её лучшем исполнении. 25 красных роз с бархатистыми лепестками и чарующим ароматом.&lt;/p&gt;\r\n','Классика в её лучшем исполнении. 25 красных роз с бархатистыми лепестками и чарующим ароматом.','','','','',''),(47,1,'No 5','&lt;p&gt;\r\n	Сотня маленьких солнышек для ярких особ.&amp;nbsp;&lt;/p&gt;\r\n','Сотня маленьких солнышек для ярких особ. ','','','','',''),(67,1,'No 7','&lt;p&gt;\r\n	Алые искры, собранные в букет.&amp;nbsp;&lt;/p&gt;\r\n','Алые искры, собранные в букет. ','','','','',''),(41,1,'No 2','&lt;div&gt;\r\n	Классика в её лучшем исполнении. 25 красных роз с бархатистыми лепестками и чарующим ароматом.&lt;/div&gt;\r\n','Классика в её лучшем исполнении. 25 красных роз с бархатистыми лепестками и чарующим ароматом.','','','','',''),(42,1,'No 8','&lt;p&gt;\r\n	Классика в её лучшем исполнении. 25 красных роз с бархатистыми лепестками и чарующим ароматом.&lt;/p&gt;\r\n','Классика в её лучшем исполнении. 25 красных роз с бархатистыми лепестками и чарующим ароматом.','','','','',''),(30,1,'No 6','&lt;p&gt;\r\n	Классика в её лучшем исполнении. 25 красных роз с бархатистыми лепестками и чарующим ароматом.&lt;/p&gt;\r\n','Классика в её лучшем исполнении. 25 красных роз с бархатистыми лепестками и чарующим ароматом.','','','','',''),(65,1,'No 9','&lt;p&gt;\r\n	Классика в её лучшем исполнении. 25 красных роз с бархатистыми лепестками и чарующим ароматом.&lt;/p&gt;\r\n','Классика в её лучшем исполнении. 25 красных роз с бархатистыми лепестками и чарующим ароматом.','','','','',''),(28,1,'No 4','&lt;p&gt;\r\n	Пушистый букет из миниатюрных роз цвета персикового крема.&lt;/p&gt;\r\n&lt;p&gt;\r\n	Кустовая роза с большим количеством мелких бутонов на ветке. Отличается особой стойкостью и производимым эффектом умиления.&amp;nbsp;&lt;/p&gt;\r\n','Пушистый букет из миниатюрных роз цвета персикового крема.','','','','',''),(64,1,'No 3','&lt;p&gt;\r\n	Букет из роз цвета взбитых сливок с капелькой розового сиропа.&lt;/p&gt;\r\n&lt;p&gt;\r\n	Кремовые, розовато-бежевые крупные бутоны, изящно раскрываются в шикарные объемные розы.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n','Букет из роз цвета взбитых сливок с капелькой розового сиропа. ','','','','',''),(68,1,'No 10','&lt;p&gt;\r\n	пионовое облако&lt;/p&gt;\r\n','','','','','',''),(69,1,'No 11','&lt;p&gt;\r\n	Нежные, как ванильные облака, пионовидные розы Анжей Романтик. Утонченные и благородные, благоухающие элегантной сладостью.&lt;/p&gt;\r\n&lt;p&gt;\r\n	Цветок, достойный бесконечного признания в любви!&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-family: arial, helvetica, sans-serif;&quot;&gt;&lt;strong&gt;ВАЖНО:&amp;nbsp;&lt;/strong&gt;&lt;/span&gt;данный букет собирается под заказ. Пожалуйста, размещайте заказ не менее, чем за&amp;nbsp;&lt;strong&gt;3 дня&lt;/strong&gt;&amp;nbsp;до доставки. &amp;nbsp;&amp;nbsp;&lt;/p&gt;\r\n','Нежные, как ванильные облака, пионовидные розы Анжей Романтик.','','','','',''),(70,1,'No 12','','яркие пионовидные кустовые','','','','',''),(72,1,'Спец.3','&lt;p&gt;\r\n	Классика в её лучшем исполнении. 25 красных роз с бархатистыми лепестками и чарующим ароматом.&lt;/p&gt;\r\n','Классика в её лучшем исполнении. 25 красных роз с бархатистыми лепестками и чарующим ароматом.','','','','',''),(73,1,'Спец.2','&lt;p&gt;\r\n	Классика в её лучшем исполнении. 25 красных роз с бархатистыми лепестками и чарующим ароматом.&lt;/p&gt;\r\n','Классика в её лучшем исполнении. 25 красных роз с бархатистыми лепестками и чарующим ароматом.','','','','',''),(71,1,'Спец.1','&lt;p&gt;\r\n	Алые искры, собранные в букет.&amp;nbsp;&lt;/p&gt;\r\n','Алые искры, собранные в букет. ','','','','',''),(74,1,'No1','&lt;p&gt;\r\n	букет в ульяновске&lt;/p&gt;\r\n','','','','','',''),(75,1,'No1','&lt;p&gt;\r\n	букет в казани&lt;/p&gt;\r\n','','','','','',''),(76,1,'No 9','&lt;p&gt;\r\n	Классика в её лучшем исполнении. 25 красных роз с бархатистыми лепестками и чарующим ароматом.&lt;/p&gt;\r\n','Классика в её лучшем исполнении. 25 красных роз с бархатистыми лепестками и чарующим ароматом.','','','','','');
